import React from 'react'

export default function Login(props){
    let userName="";

    const change=(e)=>{
        //e.preventdefault();
        userName=e.target.value;
    }

    const submitt=()=>{
        if(userName===""){
            return
        }
        props.setUser(userName);
    }
    return(
        <div>
            <label>User Name</label>
            <input type='Text' onChange={change} ></input>
            <button onclick={submitt}>Submit</button>
        </div>
    )
}

